output_description:
Design a computational model for the described task. Your model should utilyze the given variables appropriately (but not necessarily all unless otherwise specified). 

The model should:
1. Predict only responder behavior (should target "accept = whether the participant responded accept (1) or reject (0)")
will have to pass parameter recovery tests. This should be roughly equal in priority to accuracy.
2. Be applicable to the dataset given within the task description (i.e. the model should be able
to be run using only the provided dataset structure).
4. Predict utility, where less than 0 is less than 50% likely.

For any learnable parameters in your model, you must specify finite numerical bounds (it just can not be infinity) in the variable descriptions. However, this bound should be generous. The utility variable may be unbounded (-inf to inf).

Then, provide your formal mathematical model between <MODEL> tags, followed by variable descriptions between <VARIABLES> tags. Additionally, specify the target variable that your model will predict. This should be one of the variables from the dataset above. Enclose it in <target_variable> tags.
For example: <target_variable>accept</target_variable> if your model is predicting whether a participant accepts or rejects a proposal. 

Use clear mathematical notation and ensure each variable is fully described. Every variable must be utilized within the mathematical formula provided between <MODEL> and </MODEL>, and only strictly the mathematical formula should be provided between these tags with no filler words or descriptions. For variable descriptions, provide them in a JSON format with the following structure: <VARIABLES> Bounds are by default inclusive. Please spell out the greek variable names instead of using the symbols. Finally, you should provide a short description of the model in the summary tags <SUMMARY> </SUMMARY>. This will be used to compare different computational models of the task; it should be concise and purely descriptive. Do not include generic information about the name of the tasks, since that is implied. 

{
  "variables": {
    "variable_name": {
      "description": "Clear description",
      "range": {
        "min": value,
        "max": value,
        "inclusive_min": boolean,
        "inclusive_max": boolean
      },
      "distribution": {
        "type": "distribution type",
        "parameters": {}
      },
      "learnable": boolean,
      "source": "learnable/data/calculated"
    }
  }
}
</VARIABLES>

Example #1: 
<EXAMPLE>
(Model of a Random Choice Task):
Let me think through this step by step...
[your reasoning here]

<MODEL>
U_i = β + εE + ηN
</MODEL>

<VARIABLES>
{
  "variables": {
    "U_i": {
      "description": "Utility of choosing action i",
      "range": {
        "min": "-inf",
        "max": "inf"
      },
      "learnable": false,
      "source": "calculated"
    },
    "beta": {
      "description": "Base tendency parameter (inherent preference)",
      "range": {
        "min": 0,
        "max": 1
      },
      "learnable": true,
      "source": "learnable"
    },
    "epsilon": {
      "description": "Environmental sensitivity parameter",
      "range": {
        "min": "-inf",
        "max": "inf"
      },
      "learnable": true,
      "source": "learnable"
    },
    "E": {
      "description": "Environmental cue value",
      "range": {
        "min": "-inf",
        "max": "inf"
      },
      "learnable": false,
      "source": "data"
    },
    "eta": {
      "description": "Noise parameter",
      "range": {
        "min": 0,
        "max": 1,
        "exclusive_max": true
      },
      "learnable": false,
      "source": "data"
    },
    "N": {
      "description": "Random noise drawn from normal distribution N(0,1)",
      "distribution": {
        "type": "normal",
        "mean": 0,
        "std": 1
      },
      "learnable": false,
      "source": "calculated"
    }
  }
}
</VARIABLES>
<SUMMARY>
A linear utility model combining base preference, environmental influence, and stochastic noise. The model uses two learnable parameters: a base tendency parameter (β) constrained to [0,1] and an unconstrained environmental sensitivity parameter (ε). Environmental cues and normally distributed noise modify the base utility, allowing for both systematic and random variation in choice behavior.
</SUMMARY>
</EXAMPLE>

Please be sure to provide the mathematical formula for the model between <MODEL> and </MODEL>, and the variable descriptions between <VARIABLES> and </VARIABLES>. No description of the model should be provided within the <MODEL> tags.

The parameter names you choose in your <VARIABLES> section will be used exactly as specified in subsequent code generation. Please choose clear, non-reserved parameter names that can be used directly in Python code. For example, avoid Python reserved words like 'lambda' and use alternatives like 'learning_rate' or 'lambda_param'.

complete_model_interaction.output:
Let's design a computational model to predict responder acceptance behavior in this bargaining game.  The model needs to be robust, handle potential multicollinearity, and exhibit good parameter recovery.  A key challenge is to disentangle the effects of fairness considerations (influenced by `token_self`, `token_opp`, and `combined_earning`) and self-interest (`split_self`).  A non-linear model might be better suited to capture the complex interplay of these factors.

We'll use a logistic regression model with interactions to capture non-linear relationships.  We'll include regularization to address multicollinearity, and carefully choose a set of predictors to promote parameter identifiability and reduce redundancy.

<MODEL>
logit(P(accept = 1)) = α + β1*log(split_self/(token_self*3)) + β2*log(split_opp/(token_opp*3)) + β3*(split_self/(token_self*3) * split_opp/(token_opp*3)) + γ1*trial_type + γ2*log(token_self) + γ3*log(token_opp) + λ*||β||_2 + λ*||γ||_2


</MODEL>

<VARIABLES>
{
  "variables": {
    "logit(P(accept = 1))": {
      "description": "Log-odds of accepting the proposal.",
      "range": {
        "min": "-inf",
        "max": "inf"
      },
      "learnable": false,
      "source": "calculated"
    },
    "alpha": {
      "description": "Intercept term.",
      "range": {
        "min": -100,
        "max": 100
      },
      "learnable": true,
      "source": "learnable"
    },
    "beta1": {
      "description": "Effect of relative self-gain on acceptance probability.",
      "range": {
        "min": -100,
        "max": 100
      },
      "learnable": true,
      "source": "learnable"
    },
    "beta2": {
      "description": "Effect of relative opponent-gain on acceptance probability.",
      "range": {
        "min": -100,
        "max": 100
      },
      "learnable": true,
      "source": "learnable"
    },
    "beta3": {
      "description": "Interaction term capturing the joint effect of relative self and opponent gains.",
      "range": {
        "min": -100,
        "max": 100
      },
      "learnable": true,
      "source": "learnable"
    },
    "gamma1": {
      "description": "Effect of trial type (equal, opponent more, participant more) on acceptance probability.",
      "range": {
        "min": -10,
        "max": 10
      },
      "learnable": true,
      "source": "learnable"
    },
    "gamma2": {
      "description": "Effect of log of participant's token count on acceptance probability.",
      "range": {
        "min": -10,
        "max": 10
      },
      "learnable": true,
      "source": "learnable"
    },
    "gamma3": {
      "description": "Effect of log of opponent's token count on acceptance probability.",
      "range": {
        "min": -10,
        "max": 10
      },
      "learnable": true,
      "source": "learnable"
    },
    "lambda": {
      "description": "Regularization parameter for L2 regularization (Elastic Net).",
      "range": {
        "min": 0,
        "max": 10
      },
      "learnable": true,
      "source": "learnable"
    },
    "split_self": {
      "description": "Proposed share for the participant (in £)",
      "range": {
        "min": 0,
        "max": 1000
      },
      "learnable": false,
      "source": "data"
    },
    "split_opp":{
      "description": "Proposed share for the opponent (in £)",
      "range": {
        "min": 0,
        "max": 1000
      },
      "learnable": false,
      "source": "data"
    },
    "token_self": {
      "description": "Number of tokens found by the participant",
      "range": {
        "min": 0,
        "max": 100
      },
      "learnable": false,
      "source": "data"
    },
    "token_opp": {
      "description": "Number of tokens found by the opponent",
      "range": {
        "min": 0,
        "max": 100
      },
      "learnable": false,
      "source": "data"
    },
    "trial_type": {
      "description": "Contribution type (1 = equal, 2 = opponent more, 3 = participant more)",
      "range": {
        "min": 1,
        "max": 3
      },
      "learnable": false,
      "source": "data"
    },
    "||β||_2": {
      "description": "L2 norm of beta parameters",
      "range": {
        "min": 0,
        "max": "inf"
      },
      "learnable": false,
      "source": "calculated"
    },
    "||γ||_2": {
      "description": "L2 norm of gamma parameters",
      "range": {
        "min": 0,
        "max": "inf"
      },
      "learnable": false,
      "source": "calculated"
    }

  }
}
</VARIABLES>
<target_variable>accept</target_variable>
<SUMMARY>
A logistic regression model predicting responder acceptance, incorporating non-linear terms through interactions and log transformations of key variables. L2 regularization is applied to address potential multicollinearity and improve parameter recovery. The model uses relative gains (split/tokens), trial type, and token counts to predict the probability of acceptance.</SUMMARY>

